import React, { Component } from 'react';
import { Jumbotron, Button } from 'react-bootstrap';

class JumboTronComponent extends Component {

  constructor(props){
    super(props); 
    }

  render() {
    return (
      <div>
        <Jumbotron>
          <h1>Hello, world!</h1>
          <p>{this.props.children}</p>
          /
        </Jumbotron>
      </div>
    );
  }
}
export default JumboTronComponent;
